import React from 'react';
import './App.css';
import ZibbyBlob from './ZibbyBlob';
import IconButton from './IconButton';

function App() {
  return (
    <div className="app-container">
      <h1>Zibby</h1>
      <div className="zibby-ui">
        <IconButton label="Me" notification />
        <IconButton label="ZibLine" />
        <IconButton label="Memories" badgeCount={3} />
        <ZibbyBlob />
        <IconButton label="Family & Friends" badgeCount={2} />
        <IconButton label="Journal" />
      </div>
    </div>
  );
}

export default App;
